script: |
  super -f text -I q10751.spq | sort > q10751.out

inputs:
  - name: q10751.spq
    data: |
      SELECT ALL + col1 - col0 - + ( + CAST ( + col1 AS INTEGER ) ) AS col2, col2 AS col1 FROM tab1 (FORMAT parquet) AS cor0 WHERE NULL BETWEEN NULL AND 52 / col2 - + col1 * col0;
  - name: tab1

outputs:
  - name: q10751.out
    data: |
